  (function(l) {
    if (l.search[1] === '/' ) {
      var parts = l.search.slice(1).split('&').map(function(s) { 
        return s.replace(/~and~/g, '&')
      });
      var path = parts.shift();
      var query = parts.length ? ('?' + parts.join('&')) : '';
      window.history.replaceState(null, null,
          l.pathname.slice(0, -1) + path + query + l.hash
      );
    }
  }(window.location))
</script>
